package form_data

import (
	"fmt"
	"testing"

	"github.com/aws/aws-lambda-go/events"
)

const BODY = ""

func TestParseFormData(t *testing.T) {
	request := events.APIGatewayProxyRequest{
		Body: BODY,
		Headers: map[string]string{
			"content-type":   "multipart/form-data; boundary=72f8cff363f23e07900e21dbca7119504c3c0b49ec7bcb5a7a0ecc3c1b48",
			"content-length": "16653",
		},
	}

	file, err := ParseFormData(request)
	if err != nil {
		fmt.Errorf(err.Error())
	}

	fmt.Print(string(file))
}
